import React from 'react'

const Form = ({ items, onClick }) => {

  const result = items.map(item => {
    return (
      <>
        <label>{item.labelName}</label>
        <input type={item.type} placeholder={`${item.labelName} ادخل`} required />
      </>
    )
  });

  return (
    <form>
      {result}
    </form>
  )
}

export default Form
